import './App.css';
import MyNav from './components/MyNav';
import 'bootstrap/dist/css/bootstrap.min.css'
import MyFooter from './components/MyFooter';

function App() {
  return (
    <div className="App">
      <header>
        <MyNav/>
      </header>
      <main></main>
      <footer>/MyFooter></footer>
    </div>
  );
}

export default App;
